import React, { useState } from 'react';
import {
  Paper,
  Typography,
  Box,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  Button,
  List,
  ListItem,
  ListItemText,
  Divider
} from '@mui/material';
import { DateCalendar } from '@mui/x-date-pickers/DateCalendar';
import { format, isSameDay, parseISO } from 'date-fns';
import { nl } from 'date-fns/locale';
import { Game } from '../types';
import { PickersDayProps } from '@mui/x-date-pickers/PickersDay';

interface CalendarProps {
  games: Game[];
}

const Calendar: React.FC<CalendarProps> = ({ games }) => {
  const [selectedDate, setSelectedDate] = useState<Date | null>(null);
  const [openDialog, setOpenDialog] = useState(false);

  const gamesByDate = games.reduce((acc, game) => {
    const date = game.date;
    if (!acc[date]) {
      acc[date] = [];
    }
    acc[date].push(game);
    return acc;
  }, {} as Record<string, Game[]>);

  const handleDateSelect = (date: Date | null) => {
    setSelectedDate(date);
    setOpenDialog(true);
  };

  const getGamesForDate = (date: Date) => {
    return games.filter(game => isSameDay(parseISO(game.date), date));
  };

  return (
    <Paper elevation={3} sx={{ p: 3, background: 'linear-gradient(45deg, #1a237e 30%, #0d47a1 90%)', color: 'white' }}>
      <Typography variant="h6" gutterBottom align="center">
        Kalender
      </Typography>
      <DateCalendar
        onChange={handleDateSelect}
        sx={{
          width: '100%',
          '& .MuiPickersCalendarHeader-root': {
            color: 'white',
          },
          '& .MuiPickersDay-root': {
            color: 'white',
            '&.Mui-selected': {
              backgroundColor: '#1a237e',
              '&:hover': {
                backgroundColor: '#0d47a1',
              },
            },
          },
        }}
        slots={{
          day: (props: PickersDayProps<Date>) => {
            const date = props.day;
            const gamesOnDay = getGamesForDate(date);
            const hasGames = gamesOnDay.length > 0;

            return (
              <Box
                sx={{
                  width: '100%',
                  height: '100%',
                  display: 'flex',
                  flexDirection: 'column',
                  alignItems: 'center',
                  justifyContent: 'center',
                  position: 'relative',
                  cursor: hasGames ? 'pointer' : 'default',
                  '&:hover': {
                    backgroundColor: hasGames ? 'rgba(26, 35, 126, 0.1)' : 'transparent',
                  },
                }}
                onClick={() => hasGames && handleDateSelect(date)}
              >
                <Typography>{format(date, 'd')}</Typography>
                {hasGames && (
                  <Box
                    sx={{
                      position: 'absolute',
                      bottom: 2,
                      width: 4,
                      height: 4,
                      borderRadius: '50%',
                      backgroundColor: '#1a237e',
                    }}
                  />
                )}
              </Box>
            );
          }
        }}
      />

      <Dialog
        open={openDialog}
        onClose={() => setOpenDialog(false)}
        maxWidth="sm"
        fullWidth
      >
        <DialogTitle>
          Games op {selectedDate && format(selectedDate, 'dd MMMM yyyy', { locale: nl })}
        </DialogTitle>
        <DialogContent>
          <List>
            {selectedDate && getGamesForDate(selectedDate).map((game, index) => (
              <React.Fragment key={game.id}>
                <ListItem>
                  <ListItemText
                    primary={
                      <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
                        <Typography variant="subtitle1" sx={{ color: '#4caf50' }}>
                          {game.winner}
                        </Typography>
                        <Typography variant="subtitle1" sx={{ fontWeight: 'bold' }}>
                          {game.winnerScore} - {game.loserScore}
                        </Typography>
                        <Typography variant="subtitle1" sx={{ color: '#f44336' }}>
                          {game.loser}
                        </Typography>
                      </Box>
                    }
                  />
                </ListItem>
                {index < getGamesForDate(selectedDate).length - 1 && <Divider />}
              </React.Fragment>
            ))}
          </List>
        </DialogContent>
        <DialogActions>
          <Button onClick={() => setOpenDialog(false)}>Sluiten</Button>
        </DialogActions>
      </Dialog>
    </Paper>
  );
};

export default Calendar;
